const ProjectsData = {
    "projects": [
        {
            "title": "Personal Portfolio Website",
            "description": "A personal portfolio website to showcase my projects and skills.",
            "technologies": ["HTML", "CSS", "JavaScript"],
            "date": "2022-01-15",
            "link": "https://example.com/portfolio",
            "summary": "A website to display my professional portfolio and projects.",
            "imagesrc": "https://example.com/images/portfolio.png"
        },
        {
            "title": "Weather App",
            "description": "A web application to display weather information for different locations.",
            "technologies": ["React", "API", "CSS"],
            "date": "2021-11-10",
            "link": "https://example.com/weatherapp",
            "summary": "An app to check weather updates for various locations.",
            "imagesrc": "https://example.com/images/weatherapp.png"
        },
        {
            "title": "Task Manager",
            "description": "A task management application to keep track of daily tasks.",
            "technologies": ["Node.js", "Express", "MongoDB"],
            "date": "2021-08-05",
            "link": "https://example.com/taskmanager",
            "summary": "An application to manage and organize daily tasks.",
            "imagesrc": "https://example.com/images/taskmanager.png"
        }
    ]
}

export default ProjectsData;
